TERMS-OF-USE.About-general-restriction-of-use:
Wiin heimilar þér hér með að fá aðgang að og nota þjónustuna, með fyrirvara um að farið sé að eftirfarandi skilmálum. Þú viðurkennir að misbrestur þinn á að fara eftir einhverjum þeirra felur í sér brot á þessum skilmálum:

10.1 Þú samþykkir að dreifa ekki öllu eða einhverjum hluta vefsíðunnar eða þjónustunnar, þar með talið innihaldsins, á hvaða miðli sem er, nema Wiin's veiti leiðir til slíkrar dreifingar með eiginleika sem boðinn er sem hluti af þjónustunni;

10.2 Þú samþykkir ekki að breyta eða breyta hluta vefsíðunnar eða þjónustunnar;

10.3 Þú samþykkir að fá ekki aðgang að innihaldinu á annan hátt en í gegnum myndspilunarsíður vefsíðunnar sjálfrar, leikmanns Wiin eða með öðrum hætti sem Wiin getur beinlínis tilgreint í þessum tilgangi;

10.4 Þú samþykkir að reyna ekki og mun ekki sniðganga, slökkva á eða trufla á annan hátt öryggistengda eiginleika þjónustunnar eða koma í veg fyrir eða takmarka notkun eða afritun innihaldsins eða setja neinar takmarkanir á notkun þjónustunnar eða Efni aðgengilegt á þjónustunni;

10.5 Ef þú notar Wiin's Player á vefsíðunni þinni, geturðu ekki breytt, búið til afleidd verk eða lokað á alla eða alla virkni Wiin's Player, þar með talið án takmarkana tengla aftur á vefsíðuna;

10.6 Þú samþykkir að nota ekki eða ræsa sjálfvirkt kerfi (þ.mt, án takmarkana, vélmenni, könguló eða offline spilara) með aðgang að þjónustunni á þann hátt að hún sendir fleiri beiðni skilaboð til netþjóna Wiin á tilteknum tíma en manneskja gæti þokkalega framleitt á sama tíma með því að nota staðlaða (þ.e. óbreytta) netvafra sem er aðgengilegur í viðskiptum;

10.7 Þú samþykkir að safna ekki eða safna persónulegum gögnum um neinn notanda vefsíðunnar eða þjónustu (og þú viðurkennir að þetta felur í sér reikningsheiti Wiin);

10.8 Þú samþykkir að nota ekki vefsíðuna og þjónustuna (þ.m.t. athugasemdir og tölvupóstseiginleika á vefsíðunni) til að kalla eftir viðskiptastarfsemi eða í tengslum við viðskiptafyrirtæki;

10.9 Þú samþykkir ekki að biðja notendur vefsíðunnar í viðskiptalegum tilgangi um innihald þeirra;

10.10 Þú samþykkir að fá ekki aðgang að efninu í öðrum tilgangi en persónulegri notkun sem ekki er í viðskiptalegum tilgangi samkvæmt venjulegri virkni þjónustunnar og eingöngu í þeim tilgangi samtímis stafrænni flutningi gagna um internetið;

